// SPDX-License-Identifier: GPL-3.0
// Goal
// 1.deposit the toen into the contract
// 1.1 ge the conversation rate from the chain link feeds
// 1.2 by using this function get the token back
// 2.withdraw the token from the contract
pragma solidity >=0.7.0 <0.9.0;
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
  /**
     * Network: Goerli
     * Aggregator: ETH/USD
     * Address: 0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e
     */
contract FundMe {

    uint256 MINIMUM_USD = 50*1e18;
    address[] public funders;
    mapping(address=>uint256) public addressToAmountFunded;

    function fund() public payable{

        require(getConversationRate(msg.value) >= MINIMUM_USD, "You need to spend more ETH!");
        funders.push(msg.sender);
        addressToAmountFunded[msg.sender]=msg.value;

    }

// latest price is the rate with init
   function getLatestPrice() public view returns(uint256) {
      AggregatorV3Interface priceFeed = AggregatorV3Interface(0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e);
         ( ,int256 price,,,) = priceFeed.latestRoundData();
         return uint256(price * 1e10);
   }

//    rate with decimal 
// price of the final function
function getConversationRate(uint256 ethamount) public view returns(uint256){
    uint256 ethPrice = getLatestPrice();
    //  rate with decimal 
    uint256 ethamountInUsd = (ethamount * ethPrice) / 1e18;

    return  ethamountInUsd;
}


}

